import React, { useEffect, useState } from "react";

function App() {
  const [breakLength, setBreakLength] = useState("5");
  const [sessionLength, setSessionLength] = useState("25");
  return (
    <div
      style={{ backgroundColor: "#1e555c", color: "white", height: "100vh" }}
    >
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
          alignItems: "center",
          height: "100vh",
        }}
      >
        <h1>25 + 5 Clock</h1>
        <div className="d-flex">
          <div>
            <h2>Break Length</h2>
            <div className="d-flex">
              <button>↑</button>
              <h2>{breakLength}</h2>
              <button>↓</button>
            </div>
          </div>
          <div>
            <h2>Session Length</h2>
            <div className="d-flex">
              <button>↑</button>
              <h2>{sessionLength}</h2>
              <button>↓</button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
